class ShipSelector extends React.Component {
    constructor(props){
        super(props)
        this.state = {
            shipSelected: null,
            isExpanded: false
        }
    }
    render() {
        return(
        this.state.isExpanded ?  (
            <button>Select Targets</button>
        ) :
        (
            <button></button>
        )
        )
    }
}
